import React from 'react'

function Stats(props) {
    return (
        <div>
            <h3>{props.location}</h3>
            <p>{props.confirmed}</p>
            <p>{props.dead}</p>
            <p>{props.recovered}</p>
        </div>
    )
}

export default  Stats
